import React from "react";
import { Link } from "react-router-dom";

const Orders = () => {
  return (
    <div className="order-table">
      <table>
        <tr>
          <th>name</th>
          <th>qty</th>  
          <th>price</th>
          <th>mode</th>
        </tr>
        
      </table>
    </div>
  );
};

export default Orders;
